import { LEVEL } from "./level.enum";



export class Task{
    name = '';
    description = '';
    completed = false;
    level = LEVEL.NORMAL
    constructor(name,description,completed,level){
        this.name = name;
        this.description = description;
        this.completed = completed;
        this.level = level;
    }
}
